Join us in REVELATION 6 as we study the wrath of the Lamb. Here we consider who the Lamb is, and who we are in perspective to Him. Throughout the Bible we have great opportunity to see Jesus and grow in our knowledge of Him. Jump in with both feet, to discern and regard the wrath of the Lamb.
